  \"2016-07-27T22:49:51.841915\",\n\t\"name\": \"necedah-national-wildlife-refuge-narrative-report-september-october-november-december-1955\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Necedah NWR outlines
  Refuge accomplishments from September through December of 1955. The report begins
  by summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, predators,
  rodents, mammals, and raptors- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, and vegetation control. Resource
  management is outlined; topics include grazing, fur harvesting, and timber removal.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  hunting, fishing, and violations. N-R forms are attached.\",\n\t\"license_title\":
